content:
Lamentável... Pessoas morrem todos os dias e ainda se preocupam com a terceira guerra mundial. Depois de 11-09, o mundo está passando por um momento tenso, as economias globais entraram em colapso, antigamente só a África e países latinos enfrentavam a degradação econômica, agora grandes potências estão enfrentando crises, e pela história, sabemos que quando há crise econômica, existem conflitos, o que está segurando um pouco a onda é o petróleo do Iraque que os USA simplesmente tomaram a força e assim segurou a economia americana, caso não fosse isso, certamente os USA já tinham entrado em um conflito global podendo sim desencadear a terceira guerra mundial.

Os motivos que levarão a terceira guerra mundial serão estes:

- Petróleo;
- Água potável;
- Floresta Amazônica;
- Terrorismo;
- Disputa pelo domínio da tecnologia e exploração espacial "satélites, exploração de minérios em marte e etc"
